import React from 'react';
import Navbar from './components/Navbar';
import Calling from './components/project_1/calling_back';
import Table from './components/project_2/table';
import ErrorBoundary from './components/ErrorBoundary'; // Adjust the path as necessary
import "./App.css";

function App() {
  return (
    <div className="app-container">

      <ErrorBoundary>
        <Calling />
      </ErrorBoundary>
      <ErrorBoundary>
        <Table />
      </ErrorBoundary>
    </div>
  );
}

export default App;
